script: |
  super -f text -I q3190.spq | sort > q3190.out

inputs:
  - name: q3190.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + col1 + + col2 NOT IN ( + ( + col0 ), + col0 * - - 83 + col0 + - col2 * + col0 / - col2, + 51 );
  - name: tab2

outputs:
  - name: q3190.out
    data: |
      46	51	23
      64	77	40
      75	67	58
